            }
        }
    ]
}
```

Is there any way to change the background color of an adaptive card in bot framework?

## Answer (1)

You can use the `style` property of the `Container` to set the background color.

```
{
    "type": "AdaptiveCard",
    "version": "1.0",
    "body": [
        {
            "type": "Container",
            "style": "emphasis",
            "items": [
                {
                    "type": "TextBlock",
                    "text": "This is a container with a background color",
                    "wrap": true
                }
            ],
            "style": "emphasis",
            "backgroundImage": {
                "url": "data:image/png;base64,iVBORw0KGg...."
            }
        }
    ]
}
```

The `style` property can take the following values:

- `emphasis`
- `good`
- `attention`
- `warning`
- `positive`
- `negative`

Each of these styles has a different background color.

